import React from "react";
import "./App.css";
import Home from "./component/homePage"
import Header from "./component/header"
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import { useStateValue } from "./stateProvider";

const lightTheme = {
  theme1: {
     palette: {
       type: 'light',
       primary: { main: '#37b44e' },
       secondary: { main: '#000' },
     },
  }
}
const darkTheme=  {
  theme2: {
     palette: {
       type: 'dark',
       primary: { main: '#37b44e' },
       secondary: { main: '#000' },
     },
  }}

const theme1 = createMuiTheme(lightTheme);
const theme2 = createMuiTheme(darkTheme)

function App() {
  const [{userTheme}] = useStateValue();
  console.log({userTheme})

  return (
    <MuiThemeProvider theme={userTheme? theme1 : theme2}>
    <div className="App">
        <Header/>
        <Home/>
     </div>
     </MuiThemeProvider>

  );
}

export default App;
